  "Editing, uploads, API keys and local data writes are disabled in this view.": { es: "La edición, las cargas, las claves API y las escrituras de datos locales están deshabilitadas en esta vista.", pt: "Edição, uploads, chaves de API e gravações de dados locais estão desabilitados nesta visualização.", de: "Bearbeitung, Uploads, API-Schlüssel und lokale Datenschreibvorgänge sind in dieser Ansicht deaktiviert." , ru: "В этом представлении отключены редактирование, загрузка, ключи API и запись локальных данных.", zh: "在此视图中禁用编辑、上传、API 密钥和本地数据写入。"},
  "Enable calculated Free Testosterone (derived)": { es: "Habilitar testosterona libre calculada (derivada)", pt: "Ativar testosterona livre calculada (derivada)", de: "Berechnetes freies Testosteron aktivieren (abgeleitet)" , ru: "Включить расчетный свободный тестостерон (производный)", zh: "启用计算的游离睾酮（衍生）"},
