  "Export all stored data as JSON, selected markers as CSV, or charts as PDF.": { es: "Exporte todos los datos almacenados como JSON, los marcadores seleccionados como CSV o los gráficos como PDF.", pt: "Exporte todos os dados armazenados como JSON, marcadores selecionados como CSV ou gráficos como PDF.", de: "Exportieren Sie alle gespeicherten Daten als JSON, ausgewählte Markierungen als CSV oder Diagramme als PDF." , ru: "Экспортируйте все сохраненные данные в формате JSON, выбранные маркеры в формате CSV или диаграммы в формате PDF.", zh: "将所有存储的数据导出为 JSON，将选定的标记导出为 CSV，或将图表导出为 PDF。"},
  "Extended (full context)": { es: "Extendido (contexto completo)", pt: "Estendido (contexto completo)", de: "Erweitert (vollständiger Kontext)" , ru: "Расширенный (полный контекст)", zh: "扩展（完整上下文）"},
  "Falling ferritin from a high level can be favorable; keep monitoring to avoid overcorrection.": { es: "La caída de ferritina desde un nivel alto puede ser favorable; siga monitoreando para evitar la sobrecorrección.", pt: "A queda da ferritina em níveis elevados pode ser favorável; continue monitorando para evitar correção excessiva.", de: "Ein sinkender Ferritinspiegel ab einem hohen Wert kann günstig sein; Behalten Sie die Überwachung bei, um eine Überkorrektur zu vermeiden." , ru: "Падение ферритина с высокого уровня может быть благоприятным; продолжайте мониторинг, чтобы избежать чрезмерной коррекции.", zh: "铁蛋白从高水平下降可能是有利的；持续监控以避免矫枉过正。"},
