  "Protocol Impact Timeline": { es: "Cronología del impacto del protocolo", pt: "Linha do tempo do impacto do protocolo", de: "Zeitachse der Protokollauswirkungen" , ru: "График воздействия протокола", zh: "协议影响时间表"},
  "For each protocol change, you see in plain language what changed factually and how that may relate to your protocol.": {
    es: "Para cada cambio de protocolo, ves en lenguaje simple qué cambió de forma factual y cómo puede relacionarse con tu protocolo.",
    pt: "Para cada mudança de protocolo, você vê em linguagem simples o que mudou de forma factual e como isso pode se relacionar ao seu protocolo.",
    de: "Für jede Protokolländerung sehen Sie in einfacher Sprache, was sich faktisch geändert hat und wie das mit Ihrem Protokoll zusammenhängen kann."
  , ru: "При каждом изменении протокола вы простым языком видите, что изменилось на самом деле и как это может относиться к вашему протоколу.", zh: "对于每个协议更改，您都可以用简单的语言看到实际更改的内容以及它与您的协议的关系。"},
  "How to read this": { es: "Cómo leer esto", pt: "Como ler isto", de: "So lesen Sie das" , ru: "Как это прочитать", zh: "如何阅读此内容"},
  "Measured changes are facts. The link to your protocol is an estimate, because timing, supplements, symptoms, and normal variability can also influence results.": {
    es: "Los cambios medidos son hechos. El vínculo con su protocolo es una estimación, porque el momento de la toma, los suplementos, los síntomas y la variabilidad normal también pueden influir en los resultados.",
    pt: "As mudanças medidas são fatos. A ligação com o protocolo é uma estimativa, porque o momento da coleta, suplementos, sintomas e variabilidade normal também podem influenciar os resultados.",
    de: "Gemessene Veränderungen sind Fakten. Die Verbindung zu Ihrem Protokoll ist eine Schätzung, da Entnahmezeitpunkt, Supplements, Symptome und normale Schwankungen die Ergebnisse ebenfalls beeinflussen können."
  , ru: "Измеренные изменения являются фактами. Ссылка на ваш протокол является приблизительной, поскольку время, добавки, симптомы и нормальная вариабельность также могут влиять на результаты.", zh: "测量到的变化是事实。与您的方案的链接是一个估计值，因为时间、补充剂、症状和正常变异也会影响结果。"},
  "Measured changes are factual; interpretation remains a likely association and not medical advice.": {
    es: "Los cambios medidos son factuales; la interpretación sigue siendo una asociación probable y no consejo médico.",
    pt: "As mudanças medidas são factuais; a interpretação continua sendo uma associação provável e não um aconselhamento médico.",
    de: "Gemessene Änderungen sind faktisch; die Interpretation bleibt ein wahrscheinlicher Zusammenhang und ist keine medizinische Beratung."
  , ru: "Измеренные изменения являются фактическими; интерпретация остается вероятной ассоциацией, а не медицинской консультацией.", zh: "测量的变化是真实的；解释仍然是一种可能的关联，而不是医疗建议。"},
  "These insights use real measurements from your lab reports. The change after a protocol adjustment is factually measured. Whether that change is fully caused by the protocol remains an estimate, because timing, supplements, symptoms, and normal variability can also influence results.": {
    es: "Estos insights usan mediciones reales de sus informes de laboratorio. El cambio tras un ajuste del protocolo está medido de forma factual. Si ese cambio fue totalmente causado por el protocolo sigue siendo una estimación, porque el momento de muestreo, suplementos, síntomas y la variabilidad normal también pueden influir.",
    pt: "Esses insights usam medições reais dos seus relatórios laboratoriais. A mudança após um ajuste de protocolo é medida de forma factual. Se essa mudança foi totalmente causada pelo protocolo ainda é uma estimativa, porque o momento da coleta, suplementos, sintomas e a variabilidade normal também podem influenciar.",
    de: "Diese Insights verwenden echte Messwerte aus Ihren Laborberichten. Die Veränderung nach einer Protokollanpassung ist faktisch gemessen. Ob diese Veränderung vollständig durch das Protokoll verursacht wurde, bleibt eine Schätzung, da Zeitpunkt, Supplements, Symptome und normale Schwankungen ebenfalls Einfluss haben können."
  , ru: "Эти данные основаны на реальных измерениях из отчетов вашей лаборатории. Изменение после корректировки протокола фактически измеряется. Является ли это изменение полностью вызванным протоколом, остается оценочным, поскольку время, добавки, симптомы и нормальная вариабельность также могут влиять на результаты.", zh: "这些见解使用实验室报告中的真实测量结果。协议调整后的变化是实际测量的。这种变化是否完全由方案引起仍然是一个估计，因为时间、补充剂、症状和正常变异也会影响结果。"},
