  "Reading order: 1) review 'Positive signals' first, 2) see what is already going well, 3) then review 'Action needed' for attention points.": { es: "Orden de lectura: 1) revise primero las \"Señales positivas\", 2) vea lo que ya va bien, 3) luego revise las \"Acciones necesarias\" para conocer los puntos de atención.", pt: "Ordem de leitura: 1) revise primeiro os 'Sinais positivos', 2) veja o que já está indo bem, 3) depois revise 'Ação necessária' para pontos de atenção.", de: "Lesereihenfolge: 1) Überprüfen Sie zuerst „Positive Signale“, 2) sehen Sie, was bereits gut läuft, 3) überprüfen Sie dann „Handlungsbedarf“ für Aufmerksamkeitspunkte." , ru: "Порядок чтения: 1) сначала просмотрите «Положительные сигналы», 2) посмотрите, что уже идет хорошо, 3) затем просмотрите «Необходимые действия» для определения точек внимания.", zh: "阅读顺序：1）首先查看“积极信号”，2）查看哪些事情已经进展顺利，3）然后查看“需要采取行动”以了解注意点。"},
