  "Shows the configured optimal target zone for markers that have a known target band.": { es: "Muestra la zona objetivo óptima configurada para marcadores que tienen una banda objetivo conocida.", pt: "Mostra a faixa-alvo ideal configurada para marcadores que têm uma faixa objetivo conhecida.", de: "Zeigt die konfigurierte optimale Zielzone für Marker mit bekanntem Zielbereich an." , ru: "Показывает настроенную оптимальную целевую зону для маркеров, имеющих известный целевой диапазон.", zh: "显示为具有已知目标条带的标记物配置的最佳目标区域。"},
